import React from "react";
import googleWritingSvg from "..google-writing-svg.svg";


export const LoginForm = ({
    username,
    setUsername,
    password,
    setPassword
}) => {
    return (
        <div id='log-in-container'>
        <img src={googleWritingSvg} alt="Google Writing" id="google-writing"/>
        <h2>Username</h2>
        <h2>Password</h2>
        <h2>LOGIN</h2>
        <p>Forgot Username?</p>
        <p>Forgot Password?</p>
        <p>Create account</p>
      </div>
  );
}
